import { combineReducers} from 'redux';

import {SellerReducer,Filtered} from './Seller.js';
import {navbarChecker} from './navbar.js'
import {authReducer} from './auth.js';

const reducers = combineReducers({
    allSeller : SellerReducer,
    navbar: navbarChecker,
    Filtered : Filtered,
    auth : authReducer
});

export default reducers;
